import withLayout from '../components/Layout';

function Layout(frontMatter) {
	return ({ children: content }) => {
	  return (
		<div>
		  <h1>{frontMatter.title}</h1>
		  {content}
		</div>
	  )
	}
  }

  withLayout(Layout)
